// Amarillo ATS — Montserrat Font Module
// Police Montserrat encodée base64 pour jsPDF
// Variantes : Regular (normal), Bold (bold)
// Source : Google Fonts — https://fonts.google.com/specimen/Montserrat

const MontserratFont = (() => {

  const REGULAR_BASE64 = '';

  const BOLD_BASE64 = '';

  function register(doc) {
    if (!doc || typeof doc.addFileToVFS !== 'function') {
      console.warn('MontserratFont: doc.addFileToVFS non disponible');
      return;
    }

    // Register Regular
    doc.addFileToVFS('Montserrat-Regular.ttf', REGULAR_BASE64);
    doc.addFont('Montserrat-Regular.ttf', 'Montserrat', 'normal');

    // Register Bold
    doc.addFileToVFS('Montserrat-Bold.ttf', BOLD_BASE64);
    doc.addFont('Montserrat-Bold.ttf', 'Montserrat', 'bold');

    // Set as default
    doc.setFont('Montserrat', 'normal');
  }

  return { register };
})();
